function drawChart(chartId, imageString) {
    var divElement = document.getElementById(chartId);
    var imageElement = document.createElement('img');
    imageElement.setAttribute('src', 'data:image/png;base64,' + imageString);
    imageElement.setAttribute('alt', 'Embedded Chart');
    imageElement.setAttribute('class', 'chart');
    divElement.appendChild(imageElement);
}